import React from "react";

const ContactDate = () => {
  return (
    <div class="container-oder">
      <div class="oder__description-title">Інформація для доставки</div>
      <div>
        <input type="text" name="username" />
      </div>
      <div>
        <input type="password" name="password" />
      </div>
    </div>
  );
};

export default ContactDate;
